const Fart = new Audio('data:audio/mpeg;base64,');
var Farted = false

function PlayFart(mode) {
  Farted = true
  if (mode == 'fast') {
    Fart.playbackRate = 2
  } else if (mode == 'big') {
    Fart.playbackRate = 0.5
  } else {
    Fart.playbackRate = 1
  }
  Fart.currentTime = 0.1
  Fart.play();
  setTimeout(() => {Farted = false}, 200)
}

(function(Scratch) {
  class fart {
    getInfo() {
      return {
        id: 'fartfart',
        name: 'Fart',
        blocks: [
          {
            opcode: 'TheFart',
            blockType: Scratch.BlockType.COMMAND,
            text: 'fart[mode]',
            arguments: {
              mode: {
                type: Scratch.ArgumentType.STRING,
                menu: 'FART_MENU'
              }
            }
          },
          {
            opcode: 'WhenFart',
            blockType: Scratch.BlockType.EVENT,
            text: 'when a sprite farts',
            isEdgeActivated: false
          },
          {
            opcode: 'FartDetect',
            blockType: Scratch.BlockType.BOOLEAN,
            text: 'a sprite farted?',
          }
        ],
        menus: {
          FART_MENU: {
            acceptReporters: true,
            items: ['normal','fast','big']
          }
        }
      };
    }
    TheFart(args, util) {
      util.startHats('fartfart_WhenFart')
      PlayFart(args.mode);
    }
    FartDetect() {
      return Farted;
    }
  }
  Scratch.extensions.register(new fart());
})(Scratch);
